pragma solidity ^0.5.0;

contract SimpleStorage {event __CoverageSimpleStorage(string fileName, uint256 lineNumber);
event __FunctionCoverageSimpleStorage(string fileName, uint256 fnId);
event __StatementCoverageSimpleStorage(string fileName, uint256 statementId);
event __BranchCoverageSimpleStorage(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageSimpleStorage(string fileName, uint256 branchId);
event __AssertPostCoverageSimpleStorage(string fileName, uint256 branchId);

  uint storedData;

  function set(uint x) public {emit __FunctionCoverageSimpleStorage('/home/oxoft/Documents/dapp/contracts/SimpleStorage.sol',1);

emit __CoverageSimpleStorage('/home/oxoft/Documents/dapp/contracts/SimpleStorage.sol',7);
    emit __StatementCoverageSimpleStorage('/home/oxoft/Documents/dapp/contracts/SimpleStorage.sol',1);
storedData = x;
  }

  function get() public      returns (uint) {emit __FunctionCoverageSimpleStorage('/home/oxoft/Documents/dapp/contracts/SimpleStorage.sol',2);

emit __CoverageSimpleStorage('/home/oxoft/Documents/dapp/contracts/SimpleStorage.sol',11);
    emit __StatementCoverageSimpleStorage('/home/oxoft/Documents/dapp/contracts/SimpleStorage.sol',2);
return storedData;
  }
}
